import React from "react";
import {
  BentoGrid,
  MainContainer,
  NavBar,
  ProfileContainer,
  SideContainer,
  StyledButton,
} from "./styles";
import { ArrowRightCircleFill } from "@styled-icons/bootstrap";

const Home: React.FC = () => {
  return (
    <>
      <BentoGrid>
        <MainContainer>
          <NavBar>hello</NavBar>
          <ProfileContainer>
            hello
            <StyledButton color="#D36060">
              Learn more about me
              <ArrowRightCircleFill size={20}/>  
            </StyledButton>
            <StyledButton color="#E0607E">
              Contact me
              <ArrowRightCircleFill size={20}/>  
            </StyledButton>

          </ProfileContainer>
        </MainContainer>
        <SideContainer>Image here</SideContainer>
      </BentoGrid>
    </>
  );
};

export default Home;
